- input: "TEXT\x1CC00338954\x1CX0\x1C\x1CF3A\x1CDear Ms. Sugarman, Please be advised
    that the committee is amending this report in response to your letter dated December
    7, 2010. Said letter stated that there was a discrepancy in the cycle to date
    totals for the Amended 12 Day Pre-Primary Report. The committee has ascertained
    that this was caused by the re-classification of the contribution of Coviden after
    the July Quarterly was filed. Accordingly, the committee is amending this report
    to reflect the correction in contribution type and the reports going forward.
    We trust this amendment and the subsequent report amendments remedies the issue,
    however, feel free to contact me if there is anything further you require. Sincerily,
    SCOTT G. KAUFMAN, Treasurer. \n"
